import React from "react";

import Category from "../Components/Category";

import {Switch,Route} from "react-router-dom";


function Home(){
    return(
        <div>
            <Switch>
                <Route path={"/category/:category"}> <Category /> </Route>
            </Switch>
        </div>
    )
};

export default Home;
